/*
 * @author: caleb jaquith - tealium, inc.
 *
 * @extension: form-event-timer
 *
 * @scope: DOM Ready
 *
 * @purpose: a simple event timer. first call initializes (returns undefined),
 *           each subsequent call returns the amount of time elapsed since
 *           previous call (in seconds, rounds down to nearest whole second).
 */

 (function () {
  // make sure there's a global TEALIUM object
  TEALIUM = window.TEALIUM = window.TEALIUM || {};

  // make sure window.utag is defined
  window.utag = window.utag || {};

  // if utag is not loaded on the page, spoof a QA environment
  if (!window.utag.cfg) {
    window.utag = {&quot;cfg&quot;: {&quot;path&quot;: &quot;/qa/&quot;}};
  }

  // returns the amount of time since the last call
  // first event is just an start event, return undefined
  TEALIUM.eventTimer = function (event) {
    // write timestamp to a variable and cookie parameter
    function writeTimestamp (timestamp) {
      // store the current time to use for the next event
      TEALIUM.eventTimer.lastEventTime = timestamp;
      // also persist in a cookie for an hour, to use on 'complete' pages
      utag.loader.SC(&quot;utag_main&quot;, {&quot;lastEventTime&quot;: timestamp + &quot;;exp-1h&quot;});
    }

    // clear the variable and cookie parameter
    function clearTimestamp () {
      // delete the stored timestamp
      delete TEALIUM.eventTimer.lastEventTime;
      // remove this cookie parameter
      utag.loader.SC(&quot;utag_main&quot;, {&quot;lastEventTime&quot;:&quot;&quot;},&quot;d&quot;);
    }

    // clear the variable and cookie parameter
    function getElapsedTime (timestamp) {
      // get the old event time
      var lastEventTime = utag.loader.RC(&quot;utag_main&quot;).lastEventTime || TEALIUM.eventTimer.lastEventTime;
      if (typeof lastEventTime != &quot;undefined&quot;) {
        // raw elapsed value in ms
        var elapsedRaw = timestamp - lastEventTime;
        // value in seconds, no rounding
        var elapsed = Math.floor(elapsedRaw / 1000);
        TEALIUM.eventTimer.log.event (&quot;Elapsed time is &quot; + elapsed + &quot; second(s).&quot;);
        // store the current time to use for the next event
        writeTimestamp(timestamp);
        return elapsed;
      }
    }

    // get current timestamp
    var currentDate = new Date(),
        timestamp = currentDate.getTime()
    ;

    // three different types of calls
    switch (event) {
      case 'start':
        // first call, nothing to subtract yet
        TEALIUM.eventTimer.log.message (&quot;Timer started!&quot;);
        // store the current time to use for the next event
        writeTimestamp(timestamp);
        return;
        break;
      case 'progress':
        var elapsed = getElapsedTime(timestamp);
        return elapsed;
        break;
      case 'complete':
        var elapsed = getElapsedTime(timestamp);
        // clear out the stored values, leave a clean slate for the next form
        clearTimestamp();
        TEALIUM.eventTimer.log.message (&quot;Timer ended and reset.&quot;);
        // return the value
        return elapsed;
        break;
    }
  }

  // only write to console in non-production environments
  TEALIUM.eventTimer.log = {
    &quot;event&quot;: function(time) {
      if (!/\/prod\//.test(utag.cfg.path)) {
        console.info(&quot;TEALIUM TIMER EVENT ::&quot;, time);
      }
    },
    &quot;message&quot;: function(message) {
      if (!/\/prod\//.test(utag.cfg.path)) {
        console.info(&quot;TEALIUM TIMER MESSAGE ::&quot;, message);
      }
    }
  }
 }());

